(("undefined"!=typeof globalThis?globalThis:self)["makoChunk_@ant-design/x"]=("undefined"!=typeof globalThis?globalThis:self)["makoChunk_@ant-design/x"]||[]).push([["94450ff4"],{"94450ff4":function(e,n,a){"use strict";a.d(n,"__esModule",{value:!0}),a.d(n,"texts",{enumerable:!0,get:function(){return t;}}),a("f5c39f8b");let t=[{value:"Here\u2019s the translation of your guide on using ",paraId:0},{value:"@ant-design/x",paraId:0},{value:" with Umi:",paraId:0},{value:"In real-world project development, in addition to UI libraries like Ant Design X, you might also need various tools such as build tools, routing solutions, CSS solutions, data flow solutions, request libraries, internationalization, permissions, and icons to complete a project. Based on business scenarios, we recommend using ",paraId:1},{value:"Umi",paraId:1},{value:", a React-based enterprise-level application framework.",paraId:1},{value:'Umi, pronounced "\u4E4C\u7C73" in Chinese, is an extensible enterprise-grade front-end application framework. It is also the underlying front-end framework for Ant Group and has directly or indirectly served over 10,000 applications. Umi is route-based and supports both configuration-based and convention-based routing, ensuring comprehensive routing functionality and feature expansion. It is complemented by a plugin system with a complete lifecycle, covering every stage from source code to build output and supporting various functional and business needs.',paraId:2},{value:"This guide will walk you through creating a simple application with Umi and Ant Design X from scratch.",paraId:3},{value:"It is recommended to use ",paraId:4,tocIndex:0},{value:"pnpm",paraId:4,tocIndex:0},{value:" to create the Umi scaffold. Execute the following command:",paraId:4,tocIndex:0},{value:"$ mkdir myapp && cd myapp\n$ pnpm create umi\n",paraId:5,tocIndex:0},{value:"If you use npm, you can execute ",paraId:6,tocIndex:0},{value:"npm create umi",paraId:6,tocIndex:0},{value:", which has the same effect; if you use yarn, you can execute ",paraId:6,tocIndex:0},{value:"yarn create umi",paraId:6,tocIndex:0},{value:", which also works; if you use bun, you are quite trendy, and you can execute ",paraId:6,tocIndex:0},{value:"bunx create-umi",paraId:6,tocIndex:0},{value:" (note that there is a ",paraId:6,tocIndex:0},{value:"-",paraId:6,tocIndex:0},{value:" between ",paraId:6,tocIndex:0},{value:"create",paraId:6,tocIndex:0},{value:" and ",paraId:6,tocIndex:0},{value:"umi",paraId:6,tocIndex:0},{value:").",paraId:6,tocIndex:0},{value:'Select "Simple App" since we are starting from "0."',paraId:7,tocIndex:0},{value:"? Pick Umi App Template \u203A - Use arrow-keys. Return to submit.\n\u276F   Simple App\n    Ant Design Pro\n    Vue Simple App\n",paraId:8,tocIndex:0},{value:'It is recommended to select "pnpm" because it performs better in speed and handling phantom dependencies.',paraId:9,tocIndex:0},{value:"? Pick Npm Client \u203A - Use arrow-keys. Return to submit.\n    npm\n    cnpm\n    tnpm\n    yarn\n\u276F   pnpm\n",paraId:10,tocIndex:0},{value:'For users in China, it is recommended to select "taobao" for faster dependency installation. Otherwise, select "npm." Choosing npm taobao source usually speeds up dependency installation.',paraId:11,tocIndex:0},{value:"? Pick Npm Registry \u203A - Use arrow-keys. Return to submit.\n    npm\n\u276F   taobao\n",paraId:12,tocIndex:0},{value:"The tool will automatically install dependencies and execute Umi's initialization script.",paraId:13,tocIndex:0},{value:"Before starting the project, install additional dependencies used in this tutorial:",paraId:14,tocIndex:0},{value:"$ pnpm i @umijs/plugins -D\n$ pnpm i @ant-design/x -S\n",paraId:15,tocIndex:0},{value:"Here, ",paraId:16,tocIndex:0},{value:"@umijs/plugins",paraId:16,tocIndex:0},{value:" is Umi\u2019s official plugin collection, including many plugins such as valtio, react-query, styled-components, locale, access, qiankun, etc., allowing users to enable and use them through configuration.",paraId:16,tocIndex:0},{value:"After installation, run the following command to start the project:",paraId:17,tocIndex:0},{value:"$ npm run dev\numi dev\ninfo  - Umi v4.0.46\n        \u2554\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2557\n        \u2551 App listening at:                                  \u2551\n        \u2551  >   Local: http://localhost:8000                  \u2551\nready - \u2551  > Network: http://*********:8000                  \u2551\n        \u2551                                                    \u2551\n        \u2551 Now you can open browser with the above addresses\u2191 \u2551\n        \u255A\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u2550\u255D\n",paraId:18,tocIndex:0},{value:"Click the URL in the command line to open the browser automatically. If successful, you will see the following interface:",paraId:19,tocIndex:0},{value:"We need to create a route to display a product list. First, create a route, which can be thought of as different pages in the application. Umi users generally don\u2019t need to worry about the underlying implementation, but if you are curious, Umi\u2019s routing is based on react-router@6.3 (Note: not the latest 6.4, as 6.4 includes loader and action features that Umi does not require).",paraId:20,tocIndex:1},{value:"Create a route using the following command:",paraId:21,tocIndex:1},{value:"$ npx umi g page products\nWrite: src/pages/products.tsx\nWrite: src/pages/products.less\n",paraId:22,tocIndex:1},{value:"Then modify the configuration file ",paraId:23,tocIndex:1},{value:".umirc.ts",paraId:23,tocIndex:1},{value:" to add the new route declaration.",paraId:23,tocIndex:1},{value:'import { defineConfig } from "umi";\n\nexport default defineConfig({\n  routes: [\n    { path: "/", component: "index" },\n    { path: "/docs", component: "docs" },\n+    { path: "/products", component: "products" },\n  ],\n  npmClient: "pnpm",\n});\n',paraId:24,tocIndex:1},{value:"Since the scaffold uses configuration-based routing by default, where routes are configured line by line, although cumbersome, it offers greater flexibility. This method requires adding routes to the configuration, as detailed in the ",paraId:25,tocIndex:1},{value:"Umi Routing Documentation",paraId:25,tocIndex:1},{value:". Additionally, Umi supports convention-based routing, where the file system represents the routes, so routes can work without configuration.",paraId:25,tocIndex:1},{value:"Edit the ",paraId:26,tocIndex:1},{value:"src/layouts/index.tsx",paraId:26,tocIndex:1},{value:" file to add navigation to the ",paraId:26,tocIndex:1},{value:"/products",paraId:26,tocIndex:1},{value:" path in the global layout.",paraId:26,tocIndex:1},{value:'<li>\n  <Link to="/docs">Docs</Link>\n</li>\n+ <li>\n+   <Link to="/products">Products</Link>\n+ </li>\n',paraId:27,tocIndex:1},{value:"Open ",paraId:28,tocIndex:1},{value:"http://localhost:8000/products",paraId:28,tocIndex:1},{value:", and you should see the following page if successful.",paraId:28,tocIndex:1},{value:"As the application grows, you will need to share UI elements across multiple pages or use them multiple times on a page. In Umi, you can abstract this part into a component. Let\u2019s create a ",paraId:29,tocIndex:2},{value:"ProductList",paraId:29,tocIndex:2},{value:" component to display the product list in different places.",paraId:29,tocIndex:2},{value:"Create a new file ",paraId:30,tocIndex:2},{value:"src/components/ProductList.tsx",paraId:30,tocIndex:2},{value:" with the following content.",paraId:30,tocIndex:2},{value:"import React from 'react';\nimport {\n  XProvider,\n  Bubble,\n  Sender,\n  Conversations,\n  Prompts,\n  Suggestion,\n  ThoughtChain,\n} from '@ant-design/x';\nimport { Flex, Divider, Radio, Card, Typography } from 'antd';\n\nimport type { ConfigProviderProps, GetProp } from 'antd';\nimport {\n  AlipayCircleOutlined,\n  BulbOutlined,\n  GithubOutlined,\n  SmileOutlined,\n  UserOutlined,\n} from '@ant-design/icons';\n\nexport default () => {\n  const [value, setValue] = React.useState('');\n  const [direction, setDirection] =\n    React.useState<GetProp<ConfigProviderProps, 'direction'>>('ltr');\n\n  return (\n    <>\n      <Flex gap={12} style={{ marginBottom: 16 }} align=\"center\">\n        <Typography.Text>Direction:</Typography.Text>\n        <Radio.Group value={direction} onChange={(e) => setDirection(e.target.value)}>\n          <Radio.Button value=\"ltr\">LTR</Radio.Button>\n          <Radio.Button value=\"rtl\">RTL</Radio.Button>\n        </Radio.Group>\n      </Flex>\n      <Card>\n        <XProvider direction={direction}>\n          <Flex style={{ height: 500 }} gap={12}>\n            <Conversations\n              style={{ width: 200 }}\n              defaultActiveKey=\"1\"\n              items={[\n                {\n                  key: '1',\n                  label: 'Conversation - 1',\n                  icon: <GithubOutlined />,\n                },\n                {\n                  key: '2',\n                  label: 'Conversation - 2',\n                  icon: <AlipayCircleOutlined />,\n                },\n              ]}\n            />\n            <Divider type=\"vertical\" style={{ height: '100%' }} />\n            <Flex vertical style={{ flex: 1 }} gap={8}>\n              <Bubble.List\n                style={{ flex: 1 }}\n                items={[\n                  {\n                    key: '1',\n                    placement: 'end',\n                    content: 'Hello Ant Design X!',\n                    avatar: { icon: <UserOutlined /> },\n                  },\n                  {\n                    key: '2',\n                    content: 'Hello World!',\n                  },\n                ]}\n              />\n              <Prompts\n                items={[\n                  {\n                    key: '1',\n                    icon: <BulbOutlined style={{ color: '#FFD700' }} />,\n                    label: 'Ignite Your Creativity',\n                  },\n                  {\n                    key: '2',\n                    icon: <SmileOutlined style={{ color: '#52C41A' }} />,\n                    label: 'Tell me a Joke',\n                  },\n                ]}\n              />\n              <Suggestion items={[{ label: 'Write a report', value: 'report' }]}>\n                {({ onTrigger, onKeyDown }) => {\n                  return (\n                    <Sender\n                      value={value}\n                      onChange={(nextVal) => {\n                        if (nextVal === '/') {\n                          onTrigger();\n                        } else if (!nextVal) {\n                          onTrigger(false);\n                        }\n                        setValue(nextVal);\n                      }}\n                      onKeyDown={onKeyDown}\n                      placeholder='Type \"/\" to trigger suggestion'\n                    />\n                  );\n                }}\n              </Suggestion>\n            </Flex>\n          </Flex>\n          <ThoughtChain />\n        </XProvider>\n      </Card>\n    </>\n  );\n};\n",paraId:31,tocIndex:2},{value:"Build the Application",paraId:32,tocIndex:3},{value:"After development and verifying in the development environment, you need to deploy it for users. Execute the following command:",paraId:33,tocIndex:3},{value:"$ npm run build\ninfo  - Umi v4.0.46\n\u2714 Webpack\n  Compiled successfully in 5.31s\ninfo  - File sizes after gzip:\n  122.45 kB  dist/umi.js\n  575 B      dist/src__pages__products.async.js\n  312 B      dist/src__pages__index.async.js\n  291 B      dist/layouts__index.async.js\n  100 B      dist/layouts__index.chunk.css\n  55 B       dist/src__pages__products.chunk.css\nevent - Build index.html\n",paraId:34,tocIndex:3},{value:"The build process will package all resources, including JavaScript, CSS, web fonts, images, HTML, etc. You can find these files in the ",paraId:35,tocIndex:3},{value:"dist/",paraId:35,tocIndex:3},{value:" directory.",paraId:35,tocIndex:3},{value:"We have completed a simple application. You may have more questions, such as:",paraId:36,tocIndex:4},{value:"How to handle errors uniformly?",paraId:37,tocIndex:4},{value:"How to handle more routes, such as dynamic routes, nested routes, permission routes, etc.?",paraId:37,tocIndex:4},{value:"How to use data flow solutions?",paraId:37,tocIndex:4},{value:"How to modify webpack configuration or switch to vite build mode?",paraId:37,tocIndex:4},{value:"You can:",paraId:38,tocIndex:4},{value:"Visit the ",paraId:39,tocIndex:4},{value:"Umi Official Website",paraId:39,tocIndex:4},{value:"Learn about ",paraId:39,tocIndex:4},{value:"Umi\u2019s Routing",paraId:39,tocIndex:4},{value:"Explore ",paraId:39,tocIndex:4},{value:"Umi Max",paraId:39,tocIndex:4},{value:" for higher integration",paraId:39,tocIndex:4},{value:"Learn about the out-of-the-box backend scaffolding ",paraId:39,tocIndex:4},{value:"Ant Design Pro",paraId:39,tocIndex:4},{value:"Explore advanced layouts with ",paraId:39,tocIndex:4},{value:"ProLayout",paraId:39,tocIndex:4},{value:"Learn about advanced tables with ",paraId:39,tocIndex:4},{value:"ProTable",paraId:39,tocIndex:4}];}}]);
